import "./App.css";
import { useEffect, useState } from "react";
import Home from "./components/pages/Home";
import axios from "axios";

function App(props) {

  const [state, setState] = useState({
    data: null,
    active: 0,
    term: "",
  });

  useEffect(() => {
    loadData();
  }, []);

  const loadData = () => {
    axios(props.data).then((users) => {
      setState({
        ...state,
        data: JSON.parse(users),
      });
    });
  };

  const updateData = (config) => {
    setState({
      ...state,
      ...config,
    });
  };

  return (
    <div>
      <Home />
    </div>
  );
}

export default App;
